import React from 'react';
import '../style/background.css';
import Background from '../components/backgrounds/Background';

const HomePageDesign = () => (
    <>
    <div>hi</div>
    <div className = "background" id = {props.backgroundColor}>
            <svg id = {props.blob1}></svg>
            <svg id = {props.blob2}></svg>
            <svg id = {props.blob3}></svg>
        </div>
        {/* <Background
            backgroundColor = "white"
            blob1 = "blob1-m"
            blob2 = "blob2-m"
            blob3 = "blob3-m"
        /> */}
    </>
);

export default HomePageDesign;
